insert  into `articles_articlepost`(`id`,`title`,`slug`,`body`,`creat`,`update_time`,`author_id`,`column_id`) values (17,'利用Python进行文章特征提取','Li-Yong-PythonJin-Xing-Wen-Zhang-Te-Zheng-Ti-Qu','# **怎么提取特征？？**\r\n## 使用TfidfVectorizer（（词频）\r\nterm frequency–inverse document frequency（逆向文件频率）\r\n） ，**HashingVectorizer**方法，都可以使用 \r\nTfidfVectorizer uses a in-memory vocabulary (a python dict) to map the most frequent words to features indices and hence compute a word occurrence frequency (sparse) matrix. The word frequencies are then reweighted using the Inverse Document Frequency (IDF) vector collected feature-wise over the corpus.\r\n（**TfidfVectorizer**用来计算词频矩阵，之后用idf）\r\n hashes word occurrences to a fixed dimensional space, possibly with collisions. The word count vectors are then normalized to each have l2-norm equal to one (projected to the euclidean unit-ball) which seems to be important for k-means to work in high dimensional space.\r\nHashingVectorize搞碎词的出现次数，然后变成一个固定的，空间的空间\r\nHashingVectorizer does not provide IDF weighting as this is a stateless model (the fit method does nothing). When IDF weighting is needed it can be added by pipelining its output to a TfidfTransformer instance.\r\n\r\nAdditionally, latent semantic analysis can also be used to reduce dimensionality and discover latent patterns in the data.\r\n##### ###### 另外，潜在语义分析也可以用来减少维度，发现数据中潜在的模式','2018-05-16 03:39:49.000000','2018-05-16 03:39:51.711294',13,7),(18,'大话神经网络','Da-Hua-Shen-Jing-Wang-Luo','# **怎么提取特征？？**\r\n## 使用TfidfVectorizer（（词频）\r\nterm frequency–inverse document frequency（逆向文件频率）\r\n） ，**HashingVectorizer**方法，都可以使用 \r\nTfidfVectorizer uses a in-memory vocabulary (a python dict) to map the most frequent words to features indices and hence compute a word occurrence frequency (sparse) matrix. The word frequencies are then reweighted using the Inverse Document Frequency (IDF) vector collected feature-wise over the corpus.\r\n（**TfidfVectorizer**用来计算词频矩阵，之后用idf）\r\n hashes word occurrences to a fixed dimensional space, possibly with collisions. The word count vectors are then normalized to each have l2-norm equal to one (projected to the euclidean unit-ball) which seems to be important for k-means to work in high dimensional space.\r\nHashingVectorize搞碎词的出现次数，然后变成一个固定的，空间的空间\r\nHashingVectorizer does not provide IDF weighting as this is a stateless model (the fit method does nothing). When IDF weighting is needed it can be added by pipelining its output to a TfidfTransformer instance.\r\n\r\nAdditionally, latent semantic analysis can also be used to reduce dimensionality and discover latent patterns in the data.\r\n##### ###### 另外，潜在语义分析也可以用来减少维度，发现数据中潜在的模式','2018-05-16 03:40:10.000000','2018-05-16 03:40:11.768966',13,8),(23,'Bag of words模型（主题）','Bag-of-wordsMo-Xing-Zhu-Ti','BoW模型最初应用于文本处理领域，用来对文档进行分类和识别。\r\n文档 1：“我喜欢跳舞，小明也喜欢。”\r\n文档 2：“我也喜欢唱歌。”\r\n基于以上这两个文档，便可以构造一个由文档中的关键词组成的词典：\r\n词典={1:“我”，2:“喜欢”，3:“跳舞”，4:“小明”，5:“也”，6:“唱歌”}\r\n这个词典一共包含6个不同的词语，利用词典的索引号，上面两个文档每一个都可以用一个6维向量表示（用整数数字0~n（n为正整数）表示某个单词在文档中出现的次数。\r\n，根据各个文档中关键词出现的次数，便可以将上述两个文档分别表示成向量的形式：\r\n文档 1：[1, 2, 1, 1, 1, 0]\r\n文档 2：[1, 1, 0, 0, 1, 1]\r\n这样每个文档可以表示成关键词出现频率的统计集合，类似于直方图的统计表示。\r\n来自 <http://blog.csdn.net/u012507022/article/details/52442837>\r\n来自 <http://blog.csdn.net/u012507022/article/details/52442837> \r\n来自 <http://blog.csdn.net/u012507022/article/details/52442837> \r\n来自 <http://blog.csdn.net/u012507022/article/details/52442837> \r\n来自 <http://blog.csdn.net/u012507022/article/details/52442837>\r\n来自 <http://blog.csdn.net/u012507022/article/details/52442837> \r\n\r\n\r\n\r\n+','2018-05-16 08:17:19.000000','2018-05-16 12:11:08.797867',13,7),(24,'tensorflow下的神经网络','tensorflowXia-De-Shen-Jing-Wang-Luo','其中的射线就是权重参数矩阵\r\n权重参数矩阵将像素点和神经元连接在一起\r\n\r\n组合在一起之后，我可以得到当前的特征是什么样的方式变换的\r\n\r\n（假设我有100个神经元，那么我的w1，就是100*784）						变换到隐藏层之后我们的目的是:(因为隐藏层的特征对原始特征进行了变换)，变换完了之后隐藏层的识别、分辨能力变强\r\n						那么接下来我们要做的就是分类（简单来说就是softmax的东西）想得到几个输出就写几个（此处设置为10）\r\n\r\n\r\n\r\n简单来说神经网络为我们做了特征提取的工作，在这里我们使用了梯度下降（帮助我们寻找中间什么样的特征才是最合适的），神经网络发现最合适的特征之后，就按照这种方式去构造特征，然后我就可以把神经网络构造出来了\r\n\r\n\r\n所以说神经网络做了什么：特征提取，帮我们想了一个特征提取的方式，（怎么组合好我们784个输入，组合成什么样子才是最可取的）','2018-05-16 08:18:23.000000','2018-05-16 08:18:25.557104',13,7),(26,'TfidfVectorizer','TfidfVectorizer','（2）TfidfVectorizer\r\nclass sklearn.feature_extraction.text.TfidfVectorizer(input=\'content\', encoding=\'utf-8\', decode_error=\'strict\', strip_accents=None, lowercase=True, preprocessor=None, tokenizer=None, analyzer=\'word\', stop_words=None, token_pattern=\'(?u)\\b\\w\\w+\\b\', ngram_range=(1, 1), max_df=1.0, min_df=1, max_features=None, vocabulary=None, binary=False, dtype=<class \'numpy.int64\'>, norm=\'l2\', use_idf=True, smooth_idf=True, sublinear_tf=False)\r\nTfidfVectorizer与CountVectorizer有很多相同的参数，下面只解释不同的参数\r\nbinary：默认为False，tf-idf中每个词的权值是tf*idf，如果binary设为True，所有出现的词的tf将置为1，TfidfVectorizer计算得到的tf与CountVectorizer得到的tf是一样的，就是词频，不是词频/该词所在文档的总词数。\r\nnorm：默认为\'l2\'，可设为\'l1\'或None，计算得到tf-idf值后，如果norm=\'l2\'，则整行权值将归一化，即整行权值向量为单位向量，如果norm=None，则不会进行归一化。大多数情况下，使用归一化是有必要的。\r\nuse_idf：默认为True，权值是tf*idf，如果设为False，将不使用idf，就是只使用tf，相当于CountVectorizer了。\r\nsmooth_idf：idf平滑参数，默认为True，idf=ln((文档总数+1)/(包含该词的文档数+1))+1，如果设为False，idf=ln(文档总数/包含该词的文档数)+1\r\nsublinear_tf：默认为False，如果设为True，则替换tf为1 + log(tf)。','2018-05-16 10:10:18.000000','2018-05-16 10:10:21.178055',13,7),(27,'如何简单地理解Python中的if __name__ ==','Ru-He-Jian-Dan-Di-Li-Jie-PythonZhong-De-if-name','                            通俗的理解__name__ == \'__main__\'：假如你叫小明.py，在朋友眼中，你是小明(__name__ == \'小明\')；在你自己眼中，你是你自己(__name__ == \'__main__\')。\nif __name__ == \'__main__\'的意思是：当.py文件被直接运行时，if __name__ == \'__main__\'之下的代码块将被运行；当.py文件以模块形式被导入时，if __name__ == \'__main__\'之下的代码块不被运行。（）最重要\n\nPython则不同（和java，c++，c不同，他们有程序入口，而python没有），它属于脚本语言，不像编译型语言那样先将程序编译成二进制再运行，而是动态的逐行解释运行。也就是从脚本第一行开始运行，没有统一的入口。\n2.程序入口不用看\n__name__反映一个包的结构\n__main__.py文件是一个包或者目录的入口程序。不管是用python package还是用python -m package运行，__main__.py文件总是被执行。\n                        ','2018-05-30 08:37:50.000000','2018-06-21 02:55:17.469939',1,14),(28,'神经网络','Shen-Jing-Wang-Luo','简单来说神经网络为我们做了特征提取的工作，在这里我们使用了梯度下降（帮助我们寻找中间什么样的特征才是最合适的），神经网络发现最合适的特征之后，就按照这种方式去构造特征，然后我就可以把神经网络构造出来了\r\n\r\n\r\n所以说神经网络做了什么：特征提取，帮我们想了一个特征提取的方式，（怎么组合好我们784个输入，组合成什么样子才是最可取的）','2018-05-30 08:38:40.000000','2018-05-30 08:38:49.047640',1,15),(29,'spark','spark','spark','2018-06-21 02:56:18.000000','2018-06-21 02:56:24.887129',1,7),(30,'s','s','s','2012-12-12 12:12:12.000000','2012-12-12 12:12:12.000000',1,14),(33,'Minimization of turning time for high-strength steel with a given surface roughness using the Edgeworth-Pareto optimization method\n','Minimization-of-turning-time-for-high-strength-steel-with-a-given-surface-roughness-using-the-Edgeworth-Pareto-optimization-method','This paper solves the problem of distributed estimation in the diffusion networks based on the family of normalized subband adaptive filters (NSAFs). The diffusion NSAF (DNSAF), the diffusion selective partial update NSAF (DSPU-NSAF), the diffusion fix selection NSAF (DFS-NSAF), and the diffusion dynamic selection NSAF (DDS-NSAF) are established based on the general formalism. In DSPU-NSAF, the weight coefficients are partially updated rather than the entire weights at each node during the adaptation. The DFS-NSAF selects a subset of subbands and uses them to update the weights. The dynamic selection of subbands is performed in DDS-NSAF at each node during the weigh coefficients update. In comparison with DNSAF, the DSPU-NSAF, the DFS-NSAF, and the DDS-NSAF have lower computational complexity while the convergence speed of them is close to the DNSAF. Also, by combination of SPU with FS and DS approaches, the DSPU-FS-NSAF and the DSPU-DS-NSAF are established, which are computationally efficient. In the following, based on the spatial-temporal energy conservation relation, a unified framework for mean-square performance analysis of the family of DNSAF algorithms in stationary and nonstationary environments is presented, and the theoretical expressions for learning curve and steady-state error are derived for entire network. The validity of the theoretical results and the good performance of introduced algorithms are demonstrated by several computer simulations.\n','2018-06-21 11:26:44.000000','2018-06-21 11:26:44.000000',1,14),(34,'锘縡amily of diffusion normalized subband adaptive filter algorithms over distributed networks\n','Tian-Zai-amily-of-diffusion-normalized-subband-adaptive-filter-algorithms-over-distributed-networks','This paper solves the problem of distributed estimation in the diffusion networks based on the family of normalized subband adaptive filters (NSAFs). The diffusion NSAF (DNSAF), the diffusion selective partial update NSAF (DSPU-NSAF), the diffusion fix selection NSAF (DFS-NSAF), and the diffusion dynamic selection NSAF (DDS-NSAF) are established based on the general formalism. In DSPU-NSAF, the weight coefficients are partially updated rather than the entire weights at each node during the adaptation. The DFS-NSAF selects a subset of subbands and uses them to update the weights. The dynamic selection of subbands is performed in DDS-NSAF at each node during the weigh coefficients update. In comparison with DNSAF, the DSPU-NSAF, the DFS-NSAF, and the DDS-NSAF have lower computational complexity while the convergence speed of them is close to the DNSAF. Also, by combination of SPU with FS and DS approaches, the DSPU-FS-NSAF and the DSPU-DS-NSAF are established, which are computationally efficient. In the following, based on the spatial-temporal energy conservation relation, a unified framework for mean-square performance analysis of the family of DNSAF algorithms in stationary and nonstationary environments is presented, and the theoretical expressions for learning curve and steady-state error are derived for entire network. The validity of the theoretical results and the good performance of introduced algorithms are demonstrated by several computer simulations.\n','2018-06-21 13:05:25.000000','2018-06-21 13:05:25.000000',1,14),(35,'Minimization of turning time for high-strength steel with a given surface roughness using the Edgeworth-Pareto optimization method\n','Minimization-of-turning-time-for-high-strength-steel-with-a-given-surface-roughness-using-the-Edgeworth-Pareto-optimization-method','High-strength steels are used in various civilian and military products. The initial cost of the raw materials for these products is very high. The surface roughness of these products is extremely important during the finishing pass to be accepted during the final inspection. The surface roughness should conform to the required values stated on the design drawing. The paper presents the results of experiments in turning of high-strength steel featuring three factors-cutting speed V, feed rate f, and depth of cut t-on five levels (125 specimens). These were divided into 25 groups. Each of the five groups was subjected to one common machining speed. Each group was machined using five levels of cutting depth. Each depth was processed using five levels of feed rate. Tessa was used for examination of surface roughness. There is little modern research on machining high-strength steel. The high cost of this material compels us to look for the optimum turning conditions to provide for the specified roughness of surface Ra and the minimum machining time of unit volume T (m) . As a result of our study, an artificial neural network was designed in Matlab on the basis of the MLP 3-10-1 multilayer perceptron that allows us to predict Ra of the workpiece with +/- 2.14% accuracy within the range of the experimental cutting speed, depth of cut, and feed rate values. For the first time, a Pareto frontier was obtained for Ra and T (m) of the finished workpiece from high-strength steel using the artificial neural network model that was later used to determine the optimum cutting conditions. It is possible to integrate the suggested optimization algorithms into computer-aided manufacturing using Matlab.\n','2018-06-21 13:05:25.000000','2018-06-21 13:05:25.000000',1,14),(36,'Automatic recognition of severity level for diagnosis of diabetic retinopathy using deep visual features\n','Automatic-recognition-of-severity-level-for-diagnosis-of-diabetic-retinopathy-using-deep-visual-features','Diabetic retinopathy (DR) is leading cause of blindness among diabetic patients. Recognition of severity level is required by ophthalmologists to early detect and diagnose the DR. However, it is a challenging task for both medical experts and computer-aided diagnosis systems due to requiring extensive domain expert knowledge. In this article, a novel automatic recognition system for the five severity level of diabetic retinopathy (SLDR) is developed without performing any pre- and post-processing steps on retinal fundus images through learning of deep visual features (DVFs). These DVF features are extracted from each image by using color dense in scale-invariant and gradient location-orientation histogram techniques. To learn these DVF features, a semi-supervised multilayer deep-learning algorithm is utilized along with a new compressed layer and fine-tuning steps. This SLDR system was evaluated and compared with state-of-the-art techniques using the measures of sensitivity (SE), specificity (SP) and area under the receiving operating curves (AUC). On 750 fundus images (150 per category), the SE of 92.18%, SP of 94.50% and AUC of 0.924 values were obtained on average. These results demonstrate that the SLDR system is appropriate for early detection of DR and provide an effective treatment for prediction type of diabetes.\n','2018-06-21 13:05:25.000000','2018-06-21 13:05:25.000000',1,14),(37,'A system on chip for automatic karyotyping system','A-system-on-chip-for-automatic-karyotyping-system','                                                        The Automatic karyotyping System is a computer-aided tool that automates the chromosome analysis and karyotyping processes, manually performed in most cytogenetic laboratories. Artificial neural networks (ANNs) have been widely used in chromosome classification due to their parallelism that reduces the computational complexity and time. However, existing classifiers are software-based, running on a computer that transforms the parallelism features of the ANNs into serial operations, thus significantly reducing their computing power. To efficiently address the above issue due to software implementation, we propose a Field-Programmable Gate Array-based System on Chip (SoC) architecture for human chromosome classification. The hardware implementation of such system can achieve the parallelism inherent to ANNs while reducing the power consumption and circuit size, thus the cost of designing such a system is reduced. The achieved part concerns the classification subsystem based on Kohonen neural network, which has been successfully tested on FPGA platform. (C) 2017 Elsevier Ltd. All rights reserved.\n\n                        \n                        ','2018-06-21 13:05:25.000000','2018-06-29 03:09:20.702513',1,14),(38,'Parallel power system restoration planning using heuristic initialization and discrete evolutionary programming\n','Parallel-power-system-restoration-planning-using-heuristic-initialization-and-discrete-evolutionary-programming','This paper proposes a sectionalizing planning for parallel power system restoration after a complete system blackout. Parallel restoration is conducted in order to reduce the total restoration process time. Physical and operation knowledge of the system, operating personnel experience, and computer simulation are combined in this planning to improve the system restoration and serve as a guidance for system operators/planners. Sectionalizing planning is obtained using discrete evolutionary programming optimization method assisted by heuristic initialization and graph theory approach. Set of transmission lines that should not be restored during parallel restoration process (cut set) is determined in order to sectionalize the system into subsystems or islands. Each island with almost similar restoration time is set as an objective function so as to speed up the resynchronization of the islands. Restoration operation and constraints (black start generator availability, load-generation balance and maintaining acceptable voltage magnitude within each island) is also taken into account in the course of this planning. The method is validated using the IEEE 39-bus and 118-bus system. Promising results in terms of restoration time was compared to other methods reported in the literature.\n','2018-06-21 13:05:25.000000','2018-06-21 13:05:25.000000',1,14),(39,'An integrated method of associative classification and neuro-fuzzy approach for effective mammographic classification\n','An-integrated-method-of-associative-classification-and-neuro-fuzzy-approach-for-effective-mammographic-classification','Computer-aided diagnosis has gained a significant attention in helping radiologists to improve the accuracy of mammographic detection and diagnostic decision. The aim of proposed research work is to build an efficient and accurate classifier for the classification of mammogram images using a hybrid method by incorporating Genetic Association Rule Miner (GARM) with the learning capability of neural network. A set of features is extracted that comprises of 34 features based on the second and third level of the wavelet decomposition with 13 features measured directly from the gray-level co-occurrence matrix. In order to eliminate the inappropriate features and to increase the efficiency mining process, a multivariate filter is used for feature selection. Based on the selected features, an association rule mining based on modified GARM is used to generate association rules. In the classification phase, the newly generated association rules are used as the input for the creation and training of an artificial neural network. Furthermore, an extended associative classifier using fuzzy feed-forward backpropagation neural network (ACFNN) is proposed as an effective classifier in the context of mammography. The proposed ACFNN performance is compared with associative classifier using feed-forward backpropagation neural network (ACNN). Based on the experimental results, the performance of the proposed ACFNN is improved significantly. Furthermore, it can be inferred that the mammogram classification is better by using ACFNN with accuracy of 95.1 % as compared to ACNN with 93.7 %.\n','2018-06-21 13:05:25.000000','2018-06-21 13:05:25.000000',1,14),(40,'锘縡amily of diffusion normalized subband adaptive filter algorithms over distributed networks\n','Tian-Zai-amily-of-diffusion-normalized-subband-adaptive-filter-algorithms-over-distributed-networks','This paper solves the problem of distributed estimation in the diffusion networks based on the family of normalized subband adaptive filters (NSAFs). The diffusion NSAF (DNSAF), the diffusion selective partial update NSAF (DSPU-NSAF), the diffusion fix selection NSAF (DFS-NSAF), and the diffusion dynamic selection NSAF (DDS-NSAF) are established based on the general formalism. In DSPU-NSAF, the weight coefficients are partially updated rather than the entire weights at each node during the adaptation. The DFS-NSAF selects a subset of subbands and uses them to update the weights. The dynamic selection of subbands is performed in DDS-NSAF at each node during the weigh coefficients update. In comparison with DNSAF, the DSPU-NSAF, the DFS-NSAF, and the DDS-NSAF have lower computational complexity while the convergence speed of them is close to the DNSAF. Also, by combination of SPU with FS and DS approaches, the DSPU-FS-NSAF and the DSPU-DS-NSAF are established, which are computationally efficient. In the following, based on the spatial-temporal energy conservation relation, a unified framework for mean-square performance analysis of the family of DNSAF algorithms in stationary and nonstationary environments is presented, and the theoretical expressions for learning curve and steady-state error are derived for entire network. The validity of the theoretical results and the good performance of introduced algorithms are demonstrated by several computer simulations.\n','2018-06-21 13:13:29.000000','2018-06-21 13:13:29.000000',1,14),(41,'Minimization of turning time for high-strength steel with a given surface roughness using the Edgeworth-Pareto optimization method\n','Minimization-of-turning-time-for-high-strength-steel-with-a-given-surface-roughness-using-the-Edgeworth-Pareto-optimization-method','High-strength steels are used in various civilian and military products. The initial cost of the raw materials for these products is very high. The surface roughness of these products is extremely important during the finishing pass to be accepted during the final inspection. The surface roughness should conform to the required values stated on the design drawing. The paper presents the results of experiments in turning of high-strength steel featuring three factors-cutting speed V, feed rate f, and depth of cut t-on five levels (125 specimens). These were divided into 25 groups. Each of the five groups was subjected to one common machining speed. Each group was machined using five levels of cutting depth. Each depth was processed using five levels of feed rate. Tessa was used for examination of surface roughness. There is little modern research on machining high-strength steel. The high cost of this material compels us to look for the optimum turning conditions to provide for the specified roughness of surface Ra and the minimum machining time of unit volume T (m) . As a result of our study, an artificial neural network was designed in Matlab on the basis of the MLP 3-10-1 multilayer perceptron that allows us to predict Ra of the workpiece with +/- 2.14% accuracy within the range of the experimental cutting speed, depth of cut, and feed rate values. For the first time, a Pareto frontier was obtained for Ra and T (m) of the finished workpiece from high-strength steel using the artificial neural network model that was later used to determine the optimum cutting conditions. It is possible to integrate the suggested optimization algorithms into computer-aided manufacturing using Matlab.\n','2018-06-21 13:13:29.000000','2018-06-21 13:13:29.000000',1,14),(42,'Automatic recognition of severity level for diagnosis of diabetic retinopathy using deep visual features\n','Automatic-recognition-of-severity-level-for-diagnosis-of-diabetic-retinopathy-using-deep-visual-features','Diabetic retinopathy (DR) is leading cause of blindness among diabetic patients. Recognition of severity level is required by ophthalmologists to early detect and diagnose the DR. However, it is a challenging task for both medical experts and computer-aided diagnosis systems due to requiring extensive domain expert knowledge. In this article, a novel automatic recognition system for the five severity level of diabetic retinopathy (SLDR) is developed without performing any pre- and post-processing steps on retinal fundus images through learning of deep visual features (DVFs). These DVF features are extracted from each image by using color dense in scale-invariant and gradient location-orientation histogram techniques. To learn these DVF features, a semi-supervised multilayer deep-learning algorithm is utilized along with a new compressed layer and fine-tuning steps. This SLDR system was evaluated and compared with state-of-the-art techniques using the measures of sensitivity (SE), specificity (SP) and area under the receiving operating curves (AUC). On 750 fundus images (150 per category), the SE of 92.18%, SP of 94.50% and AUC of 0.924 values were obtained on average. These results demonstrate that the SLDR system is appropriate for early detection of DR and provide an effective treatment for prediction type of diabetes.\n','2018-06-21 13:13:29.000000','2018-06-21 13:13:29.000000',1,14),(43,'A system on chip for automatic karyotyping system\n','A-system-on-chip-for-automatic-karyotyping-system','The Automatic karyotyping System is a computer-aided tool that automates the chromosome analysis and karyotyping processes, manually performed in most cytogenetic laboratories. Artificial neural networks (ANNs) have been widely used in chromosome classification due to their parallelism that reduces the computational complexity and time. However, existing classifiers are software-based, running on a computer that transforms the parallelism features of the ANNs into serial operations, thus significantly reducing their computing power. To efficiently address the above issue due to software implementation, we propose a Field-Programmable Gate Array-based System on Chip (SoC) architecture for human chromosome classification. The hardware implementation of such system can achieve the parallelism inherent to ANNs while reducing the power consumption and circuit size, thus the cost of designing such a system is reduced. The achieved part concerns the classification subsystem based on Kohonen neural network, which has been successfully tested on FPGA platform. (C) 2017 Elsevier Ltd. All rights reserved.\n','2018-06-21 13:13:29.000000','2018-06-21 13:13:29.000000',1,14),(44,'Parallel power system restoration planning using heuristic initialization and discrete evolutionary programming\n','Parallel-power-system-restoration-planning-using-heuristic-initialization-and-discrete-evolutionary-programming','This paper proposes a sectionalizing planning for parallel power system restoration after a complete system blackout. Parallel restoration is conducted in order to reduce the total restoration process time. Physical and operation knowledge of the system, operating personnel experience, and computer simulation are combined in this planning to improve the system restoration and serve as a guidance for system operators/planners. Sectionalizing planning is obtained using discrete evolutionary programming optimization method assisted by heuristic initialization and graph theory approach. Set of transmission lines that should not be restored during parallel restoration process (cut set) is determined in order to sectionalize the system into subsystems or islands. Each island with almost similar restoration time is set as an objective function so as to speed up the resynchronization of the islands. Restoration operation and constraints (black start generator availability, load-generation balance and maintaining acceptable voltage magnitude within each island) is also taken into account in the course of this planning. The method is validated using the IEEE 39-bus and 118-bus system. Promising results in terms of restoration time was compared to other methods reported in the literature.\n','2018-06-21 13:13:29.000000','2018-06-21 13:13:29.000000',1,14),(45,'An integrated method of associative classification and neuro-fuzzy approach for effective mammographic classification\n','An-integrated-method-of-associative-classification-and-neuro-fuzzy-approach-for-effective-mammographic-classification','Computer-aided diagnosis has gained a significant attention in helping radiologists to improve the accuracy of mammographic detection and diagnostic decision. The aim of proposed research work is to build an efficient and accurate classifier for the classification of mammogram images using a hybrid method by incorporating Genetic Association Rule Miner (GARM) with the learning capability of neural network. A set of features is extracted that comprises of 34 features based on the second and third level of the wavelet decomposition with 13 features measured directly from the gray-level co-occurrence matrix. In order to eliminate the inappropriate features and to increase the efficiency mining process, a multivariate filter is used for feature selection. Based on the selected features, an association rule mining based on modified GARM is used to generate association rules. In the classification phase, the newly generated association rules are used as the input for the creation and training of an artificial neural network. Furthermore, an extended associative classifier using fuzzy feed-forward backpropagation neural network (ACFNN) is proposed as an effective classifier in the context of mammography. The proposed ACFNN performance is compared with associative classifier using feed-forward backpropagation neural network (ACNN). Based on the experimental results, the performance of the proposed ACFNN is improved significantly. Furthermore, it can be inferred that the mammogram classification is better by using ACFNN with accuracy of 95.1 % as compared to ACNN with 93.7 %.\n','2018-06-21 13:13:29.000000','2018-06-21 13:13:29.000000',1,14),(46,'锘縋redictors of aging based on the analysis of heart rate variability\n','Tian-Zhui-redictors-of-aging-based-on-the-analysis-of-heart-rate-variability','Conclusion: The use of neural network computations and the modification of the algorithm through the construction of individual training samples for different age intervals, and the creation of individual ensembles of classification neural networks, therefore achieved a prediction of the age of examined persons based on the values of their time and frequency domain heart rate variability indices, with 87% accuracy for women and 85% accuracy for men in the 66-85 years age interval and at least 85% for age groups across the entire sample.\n','2018-06-21 13:14:36.000000','2018-06-21 13:14:36.000000',1,14),(47,'PRUNE: Dynamic and Decidable Dataflow for Signal Processing on Heterogeneous Platforms\n','PRUNE-Dynamic-and-Decidable-Dataflow-for-Signal-Processing-on-Heterogeneous-Platforms','The majority of contemporary mobile devices and personal computers are based on heterogeneous computing platforms that consist of a number of CPU cores and one or more graphics processing units (GPUs). Despite the high volume of these devices, there are few existing programming frameworks that target full and simultaneous utilization of all CPU and GPU devices of the platform. This article presents a dataflow-flavored model of computation (MoC) that has been developed for deploying signal processing applications to heterogeneous platforms. The presented MoC is dynamic and allows describing applications with data dependent run-time behavior. On top of the MoC, formal design rules are presented that enable application descriptions to be simultaneously dynamic and decidable. Decidability guarantees compile-time application analyzability for deadlock freedom and bounded memory. The presented MoC and the design rules are realized in a novel Open Source programming environment \"PRUNE\" and demonstrated with representative application examples from the domains of image processing, computer vision and wireless communications. Experimental results show that the proposed approach outperforms the state-of-the-art in analyzability, flexibility, and performance.\n','2018-06-21 13:14:36.000000','2018-06-21 13:14:36.000000',1,14),(48,'Parallel Distributed Processing Theory in the Age of Deep Networks\n','Parallel-Distributed-Processing-Theory-in-the-Age-of-Deep-Networks','Parallel distributed processing (PDP) models in psychology are the precursors of deep networks used in computer science. However, only PDP models are associated with two core psychological claims, namely that all knowledge is coded in a distributed format and cognition is mediated by non-symbolic computations. These claims have long been debated in cognitive science, and recent work with deep networks speaks to this debate. Specifically, single-unit recordings show that deep networks learn units that respond selectively to meaningful categories, and researchers are finding that deep networks need to be supplemented with symbolic systems to perform some tasks. Given the close links between PDP and deep networks, it is surprising that research with deep networks is challenging PDP theory.\n','2018-06-21 13:14:36.000000','2018-06-21 13:14:36.000000',1,14),(49,'Computational and Experimental Approaches to Visual Aesthetics','Computational-and-Experimental-Approaches-to-Visual-Aesthetics','                                                        Aesthetics has been the subject of long-standing debates by philosophers and psychologists alike. In psychology, it is generally agreed that aesthetic experience results from an interaction between perception, cognition, and emotion. By experimental means, this triad has been studied in the field of experimental aesthetics, which aims to gain a better understanding of how aesthetic experience relates to fundamental principles of human visual perception and brain processes. Recently, researchers in computer vision have also gained interest in the topic, giving rise to the field of computational aesthetics. With computing hardware and methodology developing at a high pace, the modeling of perceptually relevant aspect of aesthetic stimuli has a huge potential. In this review, we present an overview of recent developments in computational aesthetics and how they relate to experimental studies. In the first part, we cover topics such as the prediction of ratings, style and artist identification as well as computational methods in art history, such as the detection of influences among artists or forgeries. We also describe currently used computational algorithms, such as classifiers and deep neural networks. In the second part, we summarize results from the field of experimental aesthetics and cover several isolated image properties that are believed to have a effect on the aesthetic appeal of visual stimuli. Their relation to each other and to findings from computational aesthetics are discussed. Moreover, we compare the strategies in the two fields of research and suggest that both fields would greatly profit from a joined research effort. We hope to encourage researchers from both disciplines to work more closely together in order to understand visual aesthetics from an integrated point of view.\n\n                        \n                        ','2018-06-21 13:14:36.000000','2018-06-29 03:10:26.244856',1,14),(50,'Hybridization of computational intelligence methods for attack detection in computer networks\n','Hybridization-of-computational-intelligence-methods-for-attack-detection-in-computer-networks','The paper is devoted to identification and classification of network traffic connections by various hybridization schemes with the goal of efficient network attack detection. For this purpose the combination of different methods of computational intelligence is used, namely neural networks, immune systems, neuro-fuzzy classifiers and support vector machines. To increase the speed of processing of input vectors it is proposed to apply the method of principal components. A distinctive feature and advantage of the approach suggested is a multi-level analysis of network traffic, providing the possibility to detect attacks by a signature based technique and combining a set of adaptive detectors based on computational intelligence methods. The paper describes a software tool that is built on the basis of the proposed hybridization mechanisms. Computational experiments were carried out that serve as evidence of their effectiveness in detection of both known and unknown attacks. (C) 2016 Elsevier B.V. All rights reserved.\n','2018-06-21 13:14:36.000000','2018-06-21 13:14:36.000000',1,14),(51,'TiD-Introducing and Benchmarking an Event-Delivery System for Brain-Computer Interfaces\n','TiD-Introducing-and-Benchmarking-an-Event-Delivery-System-for-Brain-Computer-Interfaces','In this paper, we present and analyze an event distribution system for brain-computer interfaces. Events are commonly used to mark and describe incidents during an experiment and are therefore critical for later data analysis or immediate real-time processing. The presented approach, called Tools for brain-computer interaction interface D (TiD), delivers messages in XML format via a buslike system using transmission control protocol connections or shared memory. A dedicated server dispatches TiD messages to distributed or local clients. The TiD message is designed to be flexible and contains time stamps for event synchronization, whereas events describe incidents, which occur during an experiment. TiD was tested extensively toward stability and latency. The effect of an occurring event jitter was analyzed and benchmarked on a reference implementation under different conditions as gigabit and 100-Mb Ethernet or Wi-Fi with a different number of event receivers. A 3-dB signal attenuation, which occurs when averaging jitter influenced trials aligned by events, is starting to become visible at around 1-2 kHz in the case of a gigabit connection. Mean event distribution times across operating systems are ranging from 0.3 to 0.5ms for a gigabit network connection for 106 events. Results for other environmental conditions are available in this paper. References already using TiD for event distribution are provided showing the applicability of TiD for event delivery with distributed or local clients.\n','2018-06-21 13:14:36.000000','2018-06-21 13:14:36.000000',1,14),(52,'Protecting the privacy of humans in video sequences using a computer vision-based de-identification pipeline\n','Protecting-the-privacy-of-humans-in-video-sequences-using-a-computer-vision-based-de-identification-pipeline','We propose a computer vision-based de-identification pipeline that enables automated protection of privacy of humans in video sequences through obfuscating their appearance, while preserving the naturalness and utility of the de-identified data. Our pipeline specifically addresses de-identifying soft and non-biometric features, such as clothing, hair, skin color etc., which often remain recognizable when simpler techniques such as blurring are applied. Assuming a surveillance scenario, we combine background subtraction based on Gaussian mixtures with an improved version of the GrabCut algorithm to find and segment pedestrians. De-identification is performed by altering the appearance of the segmented pedestrians through the neural art algorithm that uses the responses of a deep neural network to render the pedestrian images in a different style. Experimental evaluation is performed both by automated classification and through a user study. Results suggest that the proposed pipeline successfully de-identifies a range of hard and soft biometric and non-biometric identifiers, including face, clothing and hair. (C) 2017 Elsevier Ltd. All rights reserved.\n','2018-06-21 13:14:36.000000','2018-06-21 13:14:36.000000',1,14),(53,'Pencil-like imaging spectrometer for bio-samples sensing\n','Pencil-like-imaging-spectrometer-for-bio-samples-sensing','Spectrally-resolved imaging techniques are becoming central to the investigation of bio-samples. In this paper, we demonstrate the use of a WIFI-camera as a detection module to assemble a pencil-like imaging spectrometer, which weighs only 140 g and has a size of 3.1 cm in diameter and 15.5 cm in length. The spectrometer is standalone, and works wirelessly. A smartphone or network computer can serve as the data receiver and processor. The wavelength resolution of the spectrometer is about 17 nm, providing repeatable measurements of spatial two-dimensional images at various wavelengths for various bio-samples, including bananas, meat, and human hands. The detected spectral range is 400 nm - 675 nm and a white LED array lamp is selected as the light source. Based on the detected spectra, we can monitor the impacts of chlorophyll, myoglobin, and hemoglobin on bananas, pork, and human hands, respectively. For human hand scanning, a 3D spectral image data cube, which exhibits excellent signal to background noise ratio, can be obtained within 16 sec. We envisage that the adaptation of imaging spectrometer devices to the widely-accepted smartphone technology will help to carry out on-site studies in various applications. Besides, our pencil-like imaging spectrometer is cost-effective (<$300) and easy to assemble. This portable imaging spectrometer can facilitate the collection of large amounts of spectral image data. With the help of machine learning, we can realize object recognition based on spectral classification in the future. (C) 2017 Optical Society of America\n','2018-06-21 13:14:36.000000','2018-06-21 13:14:36.000000',1,14),(54,'Partitioning Surfaces Into Quadrilateral Patches: A Survey\n','Partitioning-Surfaces-Into-Quadrilateral-Patches-A-Survey','The efficient and practical representation and processing of geometrically or topologically complex shapes often demands a partitioning into simpler patches. Possibilities range from unstructured arrangements of arbitrarily shaped patches on the one end, to highly structured conforming networks of all-quadrilateral patches on the other end of the spectrum. Due to its regularity, this latter extreme of conforming partitions with quadrilateral patches, called quad layouts, is most beneficial in many application scenarios, for instance enabling the use of tensor-product representations based on splines or Bezier patches, grid-based multi-resolution techniques and discrete pixel-based map representations. However, this type of partition is also most complicated to create due to the strict inherent structural restrictions. Traditionally often performed manually in a tedious and demanding process, research in computer graphics and geometry processing has led to a number of computer-assisted, semi-automatic, as well as fully automatic approaches to address this problem more efficiently. This survey provides a detailed discussion of this range of methods, treats their strengths and weaknesses and outlines open problems in this field of research.\n','2018-06-21 13:14:36.000000','2018-06-21 13:14:36.000000',1,14),(55,'Identifying Single Trial Event-Related Potentials in an Earphone-Based Auditory Brain-Computer Interface\n','Identifying-Single-Trial-Event-Related-Potentials-in-an-Earphone-Based-Auditory-Brain-Computer-Interface','As brain-computer interfaces (BCI) must provide reliable ways for end users to accomplish a specific task, methods to secure the best possible translation of the intention of the users are constantly being explored. In this paper, we propose and test a number of convolutional neural network (CNN) structures to identify and classify single-trial P300 in electroencephalogram (EEG) readings of an auditory BCI. The recorded data correspond to nine subjects in a series of experiment sessions in which auditory stimuli following the oddball paradigm were presented via earphones from six different virtual directions at time intervals of 200, 300, 400 and 500 ms. Using three different approaches for the pooling process, we report the average accuracy for 18 CNN structures. The results obtained for most of the CNN models show clear improvement over past studies in similar contexts, as well as over other commonly-used classifiers. We found that the models that consider data from the time and space domains and those that overlap in the pooling process usually offer better results regardless of the number of layers. Additionally, patterns of improvement with single-layered CNN models can be observed.\n','2018-06-21 13:14:36.000000','2018-06-21 13:14:36.000000',1,14),(56,'锘縉arrowband Internet of Things: Implementations and Applications\n','Tian-Jin-arrowband-Internet-of-Things-Implementations-and-Applications','Recently, narrowband Internet of Things (NB-IoT), one of the most promising low power wide area (LPWA) technologies, has attracted much attention from both academia and industry. It has great potential to meet the huge demand for machine-type communications in the era of IoT. To facilitate research on and application of NB-IoT, in this paper, we design a system that includes NB devices, an IoT cloud platform, an application server, and a user app. The core component of the system is to build a development board that integrates an NB-IoT communication module and a subscriber identification module, a micro-controller unit and power management modules. We also provide a firmware design for NB device wake-up, data sensing, computing and communication, and the IoT cloud configuration for data storage and analysis. We further introduce a framework on how to apply the proposed system to specific applications. The proposed system provides an easy approach to academic research as well as commercial applications.\n','2018-06-21 13:15:16.000000','2018-06-21 13:15:16.000000',1,14),(57,'Computer Generation of High Throughput and Memory Efficient Sorting Designs on FPGA\n','Computer-Generation-of-High-Throughput-and-Memory-Efficient-Sorting-Designs-on-FPGA','Accelerating sorting using dedicated hardware to fully utilize the memory bandwidth for Big Data applications has gained much interest in the research community. Recently, parallel sorting networks have been widely employed in hardware implementations due to their high data parallelism and low control overhead. In this paper, we propose a systematic methodology for mapping large-scale bitonic sorting networks onto FPGA. To realize data permutations in the sorting network, we develop a novel RAM-based design by vertically \"folding\" the classic Clos network. By utilizing the proposed design for data permutation, we develop a hardware generator to automatically build bitonic sorting architectures on FPGAs. For given input size, data width and data parallelism, the hardware generator specializes both the datapath and the control unit for sorting and generates a design in high level hardware description language. We demonstrate trade-offs among throughput, latency and area using two illustrative sorting designs including a high throughput design and a resource efficient design. With a data parallelism of p (2 <= p <= N/2), the high throughput design sorts an N-key sequence with latency 6N=p + o(N), throughput p results per cycle and uses 6N + o(N) memory. This achieves optimal memory efficiency (defined as the ratio of throughput to the amount of on-chip memory used by the design) and outperforms the state-of-the-art. Experimental results show that the designs obtained by our proposed hardware generator achieve 49 to 112 percent improvement in energy efficiency and 56 to 430 percent higher memory efficiency compared with the state-of-the-art.\n','2018-06-21 13:15:16.000000','2018-06-21 13:15:16.000000',1,14),(58,'Integrated MIMO Slot Antenna on Laptop Computer for Eight-Band LTE/WWAN Operation\n','Integrated-MIMO-Slot-Antenna-on-Laptop-Computer-for-Eight-Band-LTE-WWAN-Operation','This paper proposes a two-element multi-input multi-output (MIMO) open-slot antenna implemented on the display ground plane of a laptop computer for eight-band long-term evolution/wireless wide-area network operations. The metal surroundings of the antennas have been well integrated as a part of the radiation structure. In the single-element open-slot antenna, the nearby hinge slot (which is bounded by two ground planes and two hinges) is relatively large as compared with the open slot itself and acts as a good radiator. In the MIMO antenna consisting of two open-slot elements, a T slot is embedded in the display ground plane and is connected to the hinge slot. The T and hinge slots when connected behave as a radiator; whereas, the T slot itself functions as an isolation element. With the isolation element, simulated isolations between the two elements of the MIMO antenna are raised from 8.3-11.2 to 15-17.1 dB in 698-960 MHz and from 12.1-21 to 15.9-26.7 dB in 1710-2690 MHz. Measured isolations with the isolation element in the desired low-and high-frequency ranges are 17.6-18.8 and 15.2-23.5 dB, respectively. Measured and simulated efficiencies for the two-element MIMO antenna with either element excited are both larger than 50% in the desired operating frequency bands.\n','2018-06-21 13:15:16.000000','2018-06-21 13:15:16.000000',1,14),(59,'qSwitch: Dynamical Off-Chip Bandwidth Allocation Between Local and Remote Accesses\n','qSwitch-Dynamical-Off-Chip-Bandwidth-Allocation-Between-Local-and-Remote-Accesses','Multisocket computer systems are popular in workstations and servers. However, they suffer from the relatively low bandwidth of intersocket communication especially for massive parallel workloads that generate many intersocket requests for synchronizations and remote memory accesses. Intersocket traffic puts pressure on the underlying network connecting all processors with a limited bandwidth confined by pin resources. Given this constraint, we propose to dynamically increase the intersocket bandwidth by sacrificing off-chip memory bandwidth when systems have heavy intersocket communication but few off-chip memory accesses. Our design increases the physical bandwidth for intersocket communication via switching the function of pins from off-chip memory accesses to intersocket communication and can achieve an average performance speedup of 1.28 in geocentric mean for selected parallel multithreaded benchmarks.\n','2018-06-21 13:15:16.000000','2018-06-21 13:15:16.000000',1,14),(60,'Pose-and-illumination-invariant face representation via a triplet-loss trained deep reconstruction model\n','Pose-and-illumination-invariant-face-representation-via-a-triplet-loss-trained-deep-reconstruction-model','Face recognition under variable pose and illumination is a challenging problem in computer vision tasks. In this paper, we solve this problem by proposing a new residual based deep face reconstruction neural network to extract discriminative pose-and-illumination-invariant (PII) features. Our deep model can change arbitrary pose and illumination face images to the frontal view with standard illumination. We propose a new triplet-loss training method instead of Euclidean loss to optimize our model, which has two advantages: a) The training triplets can be easily augmented by freely choosing combinations of labeled face images, in this way, overfitting can be avoided; b) The triplet-loss training makes the PII features more discriminative even when training samples have similar appearance. By using our PII features, we achieve 83.8% average recognition accuracy on MultiPIE face dataset which is competitive to the state-of-the-art face recognition methods.\n','2018-06-21 13:15:16.000000','2018-06-21 13:15:16.000000',1,14),(61,'Analytic Hierarchy Process-Simulation Framework for Lighting Maintenance Decision-Making Based on the Clustered Network','Analytic-Hierarchy-Process-Simulation-Framework-for-Lighting-Maintenance-Decision-Making-Based-on-the-Clustered-Network','                            The lighting system is an important infrastructure that needs to be maintained to curb degradations caused by aging and other extraneous factors. Facility managers are responsible for system operations and confront challenges resulting from the considerable number of maintenance requests under various limitations (e.g.,budget, labor resources). Therefore, maintenance activities need to be evaluated continually to improve their efficiency. As for the lighting system, the choice of maintenance methods [i.e.,spot relamping (SR) and group relamping (GR)] has typically been made based on rules of thumb and experience. In this respect, this contribution aims to develop a framework that allows facility managers to use systematic analysis to select the most appropriate relamping strategy. The proposed framework integrates analytic hierarchy process (AHP) and simulation methods based on a preset clustered network. The framework is composed of three phases: relamping cost evaluation, carbon dioxide (CO2) emission evaluation, and comprehensive evaluation for decision making on maintenance alternatives. A case study of lighting maintenance is provided to demonstrate the applicability of the framework to the selection of an optimal relamping alternative in consideration of cost and environmental protection. Finally, a sensitivity analysis is conducted to better understand the effect of variations in the clustered network and the importance of environmental protection in the choice of the lighting maintenance procedure.\n\n                        ','2018-06-21 13:15:16.000000','2018-06-29 03:09:31.290942',1,14),(62,'Nanocrystalline gradient engineering: Grain evolution and grain boundary networks\n','Nanocrystalline-gradient-engineering-Grain-evolution-and-grain-boundary-networks','We study materials with spatial gradients in nanoscale grain size (5-120 nm), and quantitatively examine the effect of spatial gradient on microstructure evolution and thermal stability using mesoscale Monte Carlo modeling and statistical analysis. The spatial grain size gradient weakens and the grain size distribution widens at elevated temperatures, accompanied by grain rounding and movement of grains along the gradient direction. Introducing heterogeneous grain boundary networks into gradient materials leads to better preservation of the spatial grain size gradient but less equiaxed grains. Coarsening in small grain regions is accompanied by an increase in the local fraction of low-energy grain boundaries, as these are competing mechanisms for reducing total energy, and spatial gradients in grain boundary character distribution and triple junction character distribution develop in the material. We further compare concave, linear, and convex gradient materials with increasing grain size gradient for small grains. Grains in convex gradient materials have the highest grain growth rate compared to grains of the same size in linear and concave gradient materials. The accelerated grain growth in the presence of a steeper grain size gradient is attributed to a change in local grain neighbor environment that promotes grain boundary curvature (and pressure) and enhances the driving force for grain growth. (C) 2017 Elsevier B.V. All rights reserved.\n','2018-06-21 13:15:16.000000','2018-06-21 13:15:16.000000',1,14),(63,'Modelling hydraulic fracturing in a complex-fracture-network reservoir with the DDM and graph theory\n','Modelling-hydraulic-fracturing-in-a-complex-fracture-network-reservoir-with-the-DDM-and-graph-theory','Shale gas reservoirs usually contain complex natural fracture (NF) networks. Numerical simulations of NF networks in an infinite, discontinuous medium require large computational resources to store the coordinates, intersections and paths of the fractures. To reduce the computational time and save computer memory, NF networks and the expected hydraulic fracture (HF) networks are both mapped into graphs based on graph theory. A modified displacement discontinuity method (DDM) is used to simulate the deformation and propagation of HFs. The results show that the HF networks are affected primarily by the NF networks, the in situ stress and the fracturing parameters. A higher net pressure leads to a wider but shorter band of HF networks, and a greater stress contrast leads to a longer but narrower band of HF networks. A dimensional parameter psi is defined by the combination of the net pressure and the stress contrast. As psi increases, the stimulated reservoir volume (SRV) increases. The stress interaction among HFs in a fractured medium is similar to that in an isotropic homogeneous medium but is more complex because of the influence of NFs. (c) 2017 Elsevier B.V. All rights reserved.\n','2018-06-21 13:15:16.000000','2018-06-21 13:15:16.000000',1,14),(64,'Multi-objective optimization for hand posture recognition\n','Multi-objective-optimization-for-hand-posture-recognition','Hand gestures are an intuitive way for humans to interact with computers. They are becoming increasingly popular in several applications, such as smart houses, games, vehicle infotainment systems, kitchens and operating theaters. An effective human-computer interaction system should aim at both good recognition accuracy and speed. This paper proposes a new approach for static hand gesture recognition. A benchmark database with 36 gestures is used, containing variations in scale, illumination and rotation. Several common image descriptors, such as Fourier, Zernike moments, pseudo-Zernike moments, Hu moments, complex moments and Gabor features are comprehensively compared in terms of their respective accuracy and speed. Gesture recognition is undertaken by a multilayer perceptron which has a flexible structure and fast recognition. In order to achieve improved accuracy and minimize computational cost, both the feature vector and the neural network are tuned by a multi-objective evolutionary algorithm based on the Nondominated Sorting Genetic Algorithm II (NSGA-II). The proposed method is compared with state-of-the-art methods. A real-time gesture recognition system based on the proposed descriptor is constructed and evaluated. Experimental results show a good recognition rate, using a descriptor with low computational cost and reduced size. (C) 2017 Elsevier Ltd. All rights reserved.\n','2018-06-21 13:15:16.000000','2018-06-21 13:15:16.000000',1,14),(65,'Third order sinusoidal integrator (TOSSI)-based control algorithm for shunt active power filter under distorted and unbalanced voltage conditions\n','Third-order-sinusoidal-integrator-TOSSI-based-control-algorithm-for-shunt-active-power-filter-under-distorted-and-unbalanced-voltage-conditions','The performance of a shunt active power filter (SAPF) essentially depends on the accuracy of synchronization and harmonic components extraction, The conventional algorithms such as synchronous reference frame theory and instantaneous reactive power theory work well under sinusoidal and balanced grid voltage conditions. This research is mainly aimed at enhancing the performance of the SAPF when the grid voltages are unbalanced and distorted. The synchronizing signals of the voltage at the point of common coupling (PCC) and system frequency are extracted from the distorted voltages using third order sinusoidal signal integrator (TOSSI) based frequency adaptive pre-filters. In this study, the TOSSI-based filter is used to extract current harmonic components from the load current which increases the selectivity and the dynamic performance of extraction process. The performance of the proposed control approach for a SAPF under distorted and unbalanced voltage conditions is demonstrated through computer simulations and validated by experimental results.\n','2018-06-21 13:15:16.000000','2018-06-21 13:15:16.000000',1,14),(66,'锘縊bject Localization on Natural Scenes: A Survey\n','Tian-Yi-bject-Localization-on-Natural-Scenes-A-Survey','Object localization is one of the inherent tasks of computer vision. It plays an intrinsic role in object detection tasks that initiate with a recognition procedure of figuring out the presence of single/multiple instances of objects of interest in a given image. It involves determination of precise locations of object instances. This paper presents an overview of some of the popularly used approaches to the object localization problem, involving efficient branch-and-bound strategy for sub-window search, super-pixel neighborhood information based approach, boosted local structured Histogram of Oriented Gradients-Local Binary Patterns (HOG-LBP) based strategy, multi-instance learning based weakly supervised object localization, object localization by utilizing deep networks and image tag based object localization. The performance of the mentioned approaches have been compared on the basis of their results on PASCAL-VOC 2007 dataset.\n','2018-06-21 13:15:41.000000','2018-06-21 13:15:41.000000',1,14),(67,'Deep feature based contextual model for object detection\n','Deep-feature-based-contextual-model-for-object-detection','One of the most active areas in computer vision is object detection, which has made significant improvement in recent years. Current state-of-the-art object detection methods mostly adhere to the framework of the regions with convolutional neural network (R-CNN). However, they only take advantage of the local appearance features inside object bounding boxes. Since these approaches ignore the contextual information around the object proposals, the outcome of these detectors may generate a semantically incoherent interpretation of the input image. In this paper, we propose a novel object detection system which incorporates the local appearance and the contextual information. Specifically, the contextual information comprises the relationships among objects and the global scene based contextual feature generated by a convolutional neural network. The whole system is formulated as a fully connected conditional random field (CRF) defined on object proposals. Then the contextual constraints among object proposals are modeled as edges naturally. Furthermore, a fast mean field approximation method is utilized to infer in this CRF model efficiently. The experimental results demonstrate that our algorithm achieves a higher mean average precision (mAP) on PASCAL VOC 2007 datasets compared with the baseline algorithm Faster R-CNN. (C) 2017 Elsevier B.V. All rights reserved.\n','2018-06-21 13:15:42.000000','2018-06-21 13:15:42.000000',1,14),(68,'Multi-Task Vehicle Detection With Region-of-Interest Voting\n','Multi-Task-Vehicle-Detection-With-Region-of-Interest-Voting','Vehicle detection is a challenging problem in autonomous driving systems, due to its large structural and appearance variations. In this paper, we propose a novel vehicle detection scheme based on multi-task deep convolutional neural networks (CNNs) and region-of-interest (RoI) voting. In the design of CNN architecture, we enrich the supervised information with subcategory, region overlap, bounding-box regression, and category of each training RoI as a multi-task learning framework. This design allows the CNN model to share visual knowledge among different vehicle attributes simultaneously, and thus, detection robustness can be effectively improved. In addition, most existing methods consider each RoI independently, ignoring the clues from its neighboring RoIs. In our approach, we utilize the CNN model to predict the offset direction of each RoI boundary toward the corresponding ground truth. Then, each RoI can vote those suitable adjacent bounding boxes, which are consistent with this additional information. The voting results are combined with the score of each RoI itself to find a more accurate location from a large number of candidates. Experimental results on the real-world computer vision benchmarks KITTI and the PASCAL2007 vehicle data set show that our approach achieves superior performance in vehicle detection compared with other existing published works.\n','2018-06-21 13:15:42.000000','2018-06-21 13:15:42.000000',1,14),(69,'Co-Saliency Detection for RGBD Images Based on Multi-Constraint Feature Matching and Cross Label Propagation\n','Co-Saliency-Detection-for-RGBD-Images-Based-on-Multi-Constraint-Feature-Matching-and-Cross-Label-Propagation','Co-saliency detection aims at extracting the common salient regions from an image group containing two or more relevant images. It is a newly emerging topic in computer vision community. Different from the most existing co-saliency methods focusing on RGB images, this paper proposes a novel co-saliency detection model for RGBD images, which utilizes the depth information to enhance identification of co-saliency. First, the intra saliency map for each image is generated by the single image saliency model, while the inter saliency map is calculated based on the multi-constraint feature matching, which represents the constraint relationship among multiple images. Then, the optimization scheme, namely cross label propagation, is used to refine the intra and inter saliency maps in a cross way. Finally, all the original and optimized saliency maps are integrated to generate the final co-saliency result. The proposed method introduces the depth information and multi-constraint feature matching to improve the performance of co-saliency detection. Moreover, the proposed method can effectively exploit any existing single image saliency model to work well in co-saliency scenarios. Experiments on two RGBD co-saliency datasets demonstrate the effectiveness of our proposed model.\n','2018-06-21 13:15:42.000000','2018-06-21 13:15:42.000000',1,14),(70,'Machine Vision for UAS Ground Operations\n','Machine-Vision-for-UAS-Ground-Operations','This paper discusses the machine vision element of a system designed to allow Unmanned Aerial System (UAS) to perform automated taxiing around civil aerodromes, with only a monocular camera. The purpose of the computer vision system is to provide direct sensor data which can be used to validate vehicle position, in addition to detecting potential collision risks. In practice, untrained clustering is used to segment the visual feed before descriptors of each cluster (primarily colour and texture) are used to estimate the class. As the competency of each individual estimate can vary dependent on multiple factors (number of pixels, lighting conditions and even surface type). A Bayesian network is used to perform probabilistic data fusion, in order to improve the classification results. This result is shown to perform accurate image segmentation in real-world conditions, providing information viable for localisation and obstacle detection.\n','2018-06-21 13:15:42.000000','2018-06-21 13:15:42.000000',1,14),(71,'DPM: A novel distributed large-scale social graph processing framework for link prediction algorithms\n','DPM-A-novel-distributed-large-scale-social-graph-processing-framework-for-link-prediction-algorithms','Large-scale graphs have become ubiquitous in social media. Computer-based recommendations in these huge graphs pose challenges in terms of algorithm design and resource usage efficiency when processing recommendations in distributed computing environments. Moreover, recommendation algorithms for graphs, particularly link prediction algorithms, have different requirements depending of the way the underlying graph is traversed. Path-based algorithms usually perform traversals in different directions to build a large ranking of vertices to recommend, whereas random walk-based algorithms build an initial subgraph and perform several iterations on those vertices to compute the final ranking. In this work, we propose a distributed graph processing framework called Distributed Partitioned Merge (DPM), which supports both types of algorithms and we compare its performance and resource usage w.r.t. two relevant frameworks, namely Fork-Join and Pregel. In our experiments, we show that in most tests DPM outperforms both Pregel and Fork-Join in terms of recommendation time, with a minor penalization in network usage in some scenarios. (C) 2017 Elsevier B.V. All rights reserved.\n','2018-06-21 13:15:42.000000','2018-06-21 13:15:42.000000',1,14),(72,'锘縇earning and surface boundary feedbacks for colour natural scene perception\n','Tian-Sen-earning-and-surface-boundary-feedbacks-for-colour-natural-scene-perception','Boundary detection and segmentation are essential stages in object recognition and scene understanding. In this paper, we present a bio-inspired neural model of the ventral pathway for colour contour and surface perception, called LPREEN (Learning and Perceptual boundaRy rEcurrent dEtection Neural architecture). LPREEN models colour opponent processes and feedback interactions between cortical areas VI, V2, V4, and IT, which produce top-down and bottom-up information fusion. We suggest three feedback interactions that enhance and complete boundaries. Our proposed neural model contains a contour learning feedback that enhances the most probable contour positions in V1 according to a previous experience, and generates a surface perception in V4 through diffusion processes. We compared the proposed model with another bio-inspired model and two well-known contour extraction methods, using the Berkeley Segmentation Benchmark. LPREEN showed better performance than two methods and slightly worse performance than another one. (C) 2017 Elsevier B.V. All rights reserved.\n','2018-06-21 13:17:42.000000','2018-06-21 13:17:42.000000',1,14),(73,'Semantics of deductive databases with spiking neural P systems\n','Semantics-of-deductive-databases-with-spiking-neural-P-systems','The integration of symbolic reasoning systems based on logic and connectionist systems based on the functioning of living neurons is a vivid research area in computer science. In the literature, one can find many efforts where different reasoning systems based on different logics are linked to classic artificial neural networks. In this paper, we study the relation between the semantics of reasoning systems based on propositional logic and the connectionist model in the framework of membrane computing, namely, spiking neural P systems. We prove that the fixed point semantics of deductive databases without negation can be implemented in the spiking neural P systems model and such a model can also deal with negation if it is endowed with anti-spikes and annihilation rules. (C) 2017 Elsevier B.V. All rights reserved.\n','2018-06-21 13:17:42.000000','2018-06-21 13:17:42.000000',1,14),(74,'A survey on security control and attack detection for industrial cyber-physical systems\n','A-survey-on-security-control-and-attack-detection-for-industrial-cyber-physical-systems','Cyber-physical systems (CPSs), which are an integration of computation, networking, and physical processes, play an increasingly important role in critical infrastructure, government and everyday life. Due to physical constraints, embedded computers and networks may give rise to some additional security vulnerabilities, which results in losses of enormous economy benefits or disorder of social life. As a result, it is of significant to properly investigate the security issue of CPSs to ensure that such systems are operating in a safe manner. This paper, from a control theory perspective, presents an overview of recent advances on security control and attack detection of industrial CPSs. First, the typical system modeling on CPSs is summarized to cater for the requirement of the performance analysis. Then three typical types of cyber-attacks, i.e. denial-of-service attacks, replay attacks, and deception attacks, are disclosed from an engineering perspective. Moreover, robustness, security and resilience as well as stability are discussed to govern the capability of weakening various attacks. The development on attack detection for industrial CPSs is reviewed according to the categories on detection approaches. Furthermore, the security control and state estimation are discussed in detail. Finally, some challenge issues are raised for the future research. (c) 2017 Elsevier B.V. All rights reserved.\n','2018-06-21 13:17:42.000000','2018-06-21 13:17:42.000000',1,14),(75,'Deep Domain Generalization With Structured Low-Rank Constraint\n','Deep-Domain-Generalization-With-Structured-Low-Rank-Constraint','Domain adaptation nowadays attracts increasing interests in pattern recognition and computer vision field, since it is an appealing technique in fighting off weakly labeled or even totally unlabeled target data by leveraging knowledge from external well-learned sources. Conventional domain adaptation assumes that target data are still accessible in the training stage. However, we would always confront such cases in reality that the target data are totally blind in the training stage. This is extremely challenging since we have no prior knowledge of the target. In this paper, we develop a deep domain generalization framework with structured low-rank constraint to facilitate the unseen target domain evaluation by capturing consistent knowledge across multiple related source domains. Specifically, multiple domain-specific deep neural networks are built to capture the rich information within multiple sources. Meanwhile, a domain-invariant deep neural network is jointly designed to uncover most consistent and common knowledge across multiple sources so that we can generalize it to unseen target domains in the test stage. Moreover, structured low-rank constraint is exploited to align multiple domain-specific networks and the domain-invariant one in order to better transfer knowledge from multiple sources to boost the learning problem in unseen target domains. Extensive experiments are conducted on several cross-domain benchmarks and the experimental results show the superiority of our algorithm by comparing it with state-of-the-art domain generalization approaches.\n','2018-06-21 13:17:42.000000','2018-06-21 13:17:42.000000',1,14),(76,'Modeling Uncertainties in EEG Microstates: Analysis of Real and Imagined Motor Movements Using Probabilistic Clustering-Driven Training of Probabilistic Neural Networks\n','Modeling-Uncertainties-in-EEG-Microstates-Analysis-of-Real-and-Imagined-Motor-Movements-Using-Probabilistic-Clustering-Driven-Training-of-Probabilistic-Neural-Networks','Part of the process of EEG microstate estimation involves clustering EEG channel data at the global field power (GFP) maxima, very commonly using a modified K-means approach. Clustering has also been done deterministically, despite there being uncertainties in multiple stages of the microstate analysis, including the GFP peak definition, the clustering itself and in the post-clustering assignment of microstates back onto the EEG timecourse of interest. We perform a fully probabilistic microstate clustering and labeling, to account for these sources of uncertainty using the closest probabilistic analog to KM called Fuzzy C-means (FCM). We train softmax multi-layer perceptrons (MLPs) using the KM and FCM-inferred cluster assignments as target labels, to then allow for probabilistic labeling of the full EEG data instead of the usual correlation-based deterministic microstate label assignment typically used. We assess the merits of the probabilistic analysis vs. the deterministic approaches in EEG data recorded while participants perform real or imagined motor movements from a publicly available data set of 109 subjects. Though FCM group template maps that are almost topographically identical to KM were found, there is considerable uncertainty in the subsequent assignment of microstate labels. In general, imagined motor movements are less predictable on a time point-by-time point basis, possibly reflecting the more exploratory nature of the brain state during imagined, compared to during real motor movements. We find that some relationships may be more evident using FCM than using KM and propose that future microstate analysis should preferably be performed probabilistically rather than deterministically, especially in situations such as with brain computer interfaces, where both training and applying models of microstates need to account for uncertainty. Probabilistic neural network-driven microstate assignment has a number of advantages that we have discussed, which are likely to be further developed and exploited in future studies. In conclusion, probabilistic clustering and a probabilistic neural network-driven approach to microstate analysis is likely to better model and reveal details and the variability hidden in current deterministic and binarized microstate assignment and analyses.\n','2018-06-21 13:17:42.000000','2018-06-21 13:17:42.000000',1,14),(77,'Learning yacht hull adjectives and their relationship with hull surface geometry using GMDH-type neural networks for human oriented smart design\n','Learning-yacht-hull-adjectives-and-their-relationship-with-hull-surface-geometry-using-GMDH-type-neural-networks-for-human-oriented-smart-design','Several efforts have been made to describe cars by adjectives, however there is no particular work exploring adjectives describing yacht hulls which motivates this study. First, a novel design schema is developed for representing yacht hulls in 3D, which is parametric based and includes several geometric parameters quantifying the hull models. Three surveys are then conducted to learn the relationship between hulls and hull adjectives. In the first survey, yacht models with different geometries are shown to participants to form the hull adjective dictionary. Next, geometric parameters having no impact on the hull adjectives are eliminated via the second survey. Hull adjectives are then matched with yacht hull models via the third survey. The models shown in the third survey are obtained by performing sampling using the Taguchi experimental method. Finally, GMDH-type neural network (GMDH) is applied to the data sets obtained from the third survey to determine the relationships between the hull adjectives and the geometric parameters. GMDH provides mathematical models for each adjective consisting of geometric parameters with coefficients. With the outcomes of this work, we expect that communication between designers and customers can be easier, and adjective based design variations of yacht hulls can be achieved in a shorter amount of time.\n','2018-06-21 13:17:42.000000','2018-06-21 13:17:42.000000',1,14),(78,'Accelerating pseudo-marginal MCMC using Gaussian processes\n','Accelerating-pseudo-marginal-MCMC-using-Gaussian-processes','The grouped independence Metropolis Hastings (GIMH) and Markov chain within Metropolis (MCWM) algorithms are pseudo-marginal methods used to perform Bayesian inference in latent variable models. These methods replace intractable likelihood calculations with unbiased estimates within Markov chain Monte Carlo algorithms. The GIMH method has the posterior of interest as its limiting distribution, but suffers from poor mixing if it is too computationally intensive to obtain high-precision likelihood estimates. The MCWM algorithm has better mixing properties, but tends to give conservative approximations of the posterior and is still expensive. A new method is developed to accelerate the GIMH method by using a Gaussian process (GP) approximation to the log-likelihood and train this GP using a short pilot run of the MCWM algorithm. This new method called GP-GIMH is illustrated on simulated data from a stochastic volatility and a gene network model. The new approach produces reasonable posterior approximations in these examples with at least an order of magnitude improvement in computing time. Code to implement the method for the gene network example can be found at http://www.runmycode.org/companion/view/2663. (C) 2017 Elsevier B.V. All rights reserved.\n','2018-06-21 13:17:42.000000','2018-06-21 13:17:42.000000',1,14),(79,'Drainage network extraction from a high-resolution DEM using parallel programming in the .NET Framework\n','Drainage-network-extraction-from-a-high-resolution-DEM-using-parallel-programming-in-the-NET-Framework','High-resolution Digital Elevation Models (DEMs) can be used to extract high-accuracy prerequisite drainage networks. A higher resolution represents a larger number of grids. With an increase in the number of grids, the flow direction determination will require substantial computer resources and computing time. Parallel computing is a feasible method with which to resolve this problem. In this paper, we proposed a parallel programming method within the .NET Framework with a C# Compiler in a Windows environment. The basin is divided into sub-basins, and subsequently the different sub-basins operate on multiple threads concurrently to calculate flow directions. The method was applied to calculate the flow direction of the Yellow River basin from 3 arc-second resolution SRTM DEM. Drainage networks were extracted and compared with HydroSHEDS river network to assess their accuracy. The results demonstrate that this method can calculate the flow direction from high-resolution DEMs efficiently and extract high-precision continuous drainage networks. (C) 2017 Elsevier B.V. All rights reserved.\n','2018-06-21 13:17:42.000000','2018-06-21 13:17:42.000000',1,14),(80,'A hybrid deep learning CNN-ELM for age and gender classification','A-hybrid-deep-learning-CNN-ELM-for-age-and-gender-classification','                            Automatic age and gender classification has been widely used in a large amount of applications, particularly in human-computer interaction, biometrics, visual surveillance, electronic customer, and commercial applications. In this paper, we introduce a hybrid structure which includes Convolutional Neural Network (CNN) and Extreme Learning Machine (ELM), and integrates the synergy of two classifiers to deal with age and gender classification. The hybrid architecture makes the most of their advantages: CNN is used to extract the features from the input images while ELM classifies the intermediate results. We not only give the detailed deployment of our structure including design of parameters and layers, analysis of the hybrid architecture, and the derivation of back-propagation in this system during the iterations, but also adopt several measures to limit the risk of overfitting. After that, two popular datasets, such as, MORPH-II and Adience Benchmark, are used to verify our hybrid structure. Experimental results show that our hybrid architecture outperforms other studies on the same datasets by exhibiting significant performance improvement in terms of accuracy and efficiency. (c) 2017 Elsevier B.V. All rights reserved.\n\n                        ','2018-06-21 13:17:42.000000','2018-06-29 03:05:49.531323',1,14),(81,'锘緼nalysis of distributed consensus protocols with multi-equilibria under time-delays\n','Tian-Yun-nalysis-of-distributed-consensus-protocols-with-multi-equilibria-under-time-delays','In this paper, we propose a novel method for addressing the multi-equilibria consensus problem for a network of n agents with dynamics evolving in discrete-time. In this method, we introduce, for the first time in the literature, two concepts called primary and secondary layer subgraphs. Then, we present our main results on directed graphs such that multiple consensus equilibria states are achieved, thereby extending the existing single-state consensus convergence results in the literature. Furthermore, we propose an algorithm to determine the number of equilibria for any given directed graph automatically by a computer program. We also analyze the convergence properties of multi-equilibria consensus in directed networks with time-delays under the assumption that all delays are bounded. We show that introducing communication time-delays does not affect the number of equilibria of the given network. Finally, we verify our theoretical results via numerical examples. (C) 2017 The Franklin Institute. Published by Elsevier Ltd. All rights reserved.\n','2018-06-21 13:18:12.000000','2018-06-21 13:18:12.000000',1,14),(82,'Lostrego: A distributed stream-based infrastructure for the real-time gathering and analysis of heterogeneous educational data\n','Lostrego-A-distributed-stream-based-infrastructure-for-the-real-time-gathering-and-analysis-of-heterogeneous-educational-data','The quick technological evolution of the last decades has also reached learning environments, where the use of networked computing devices such as laptops, smartphones, tablets, IoT devices, servers, etc. is continuously growing. In particular, those computerized learning environments have the potential to track the activity of teachers and students in them, which enables the development of innovative applications that enrich the learning process by analyzing the collected data. The majority of related work in this field has been centered on batch gathering and analysis of the data. However, in order to integrate more reactive applications, there is a need for an infrastructure that enables the real-time collection and analysis of data in learning environments. Such an infrastructure should be scalable and flexible enough to cope with heterogeneous data coming from different types of learning settings. This paper presents Lostrego, a stream-based, modular, scalable and flexible distributed infrastructure that allows the gathering and analysis of educational data from heterogeneous data sources in a real-time fashion. Lostrego applications are composed by interconnected services that can be reused in different courses. The results of the evaluation of Lostrego in two editions of a computer programming course with 233 students and 384,702 gathered events are also reported.\n','2018-06-21 13:18:12.000000','2018-06-21 13:18:12.000000',1,14),(83,'Observer synthesis under time-varying sampling for Lipschitz nonlinear systems\n','Observer-synthesis-under-time-varying-sampling-for-Lipschitz-nonlinear-systems','In this work, the problem of observation of continuous-time nonlinear Lipschitz systems under time varying discrete measurements is considered. This class of systems naturally occurs when continuous processes are observed through digital sensors and information is sent via a network to a computer for state estimation. Since the network introduces variations in the sampling time, the observer must be designed so that it takes them into account. Here impulsive observers, which make instantaneous correction when information is received, are investigated. Moreover, we consider time-varying observer gains adapting to the varying sampling interval. In order to deal with both continuous-time and discrete time dynamics, a new hybrid model is used to state the problem and establish the convergence of the proposed observer. First, generic conditions are provided using a hybrid Lyapunov function. Then, a restriction of the generic Lyapunov function is used to establish tractable conditions that allows the analysis and synthesis of an impulsive gain. (C) 2017 Published by Elsevier Ltd.\n','2018-06-21 13:18:12.000000','2018-06-21 13:18:12.000000',1,14),(84,'Combined Computational Systems Biology and Computational Neuroscience Approaches Help Develop of Future \"Cognitive Developmental Robotics\"','Combined-Computational-Systems-Biology-and-Computational-Neuroscience-Approaches-Help-Develop-of-Future-Cognitive-Developmental-Robotics','                            Combined Computational Systems Biology and Computational Neuroscience Approaches Help Develop of Future \"Cognitive Developmental Robotics\"\n\n                        ','2018-06-21 13:18:12.000000','2018-06-29 03:10:15.480940',1,14),(85,'Esophagus segmentation in CT via 3D fully convolutional neural network and random walk\n','Esophagus-segmentation-in-CT-via-3D-fully-convolutional-neural-network-and-random-walk','Conclusion: We show that a CNN can yield accurate estimations of esophagus location, and that the results of this model can be refined by a random walk step taking pixel intensities and neighborhood relationships into account. One of the main advantages of our network over previous methods is that it performs 3D convolutions, thus fully exploiting the 3D spatial context and performing an efficient volume-wise prediction. The whole segmentation process is fully automatic and yields esophagus delineations in very good agreement with the gold standard, showing that it can compete with previously published methods. (c) 2017 American Association of Physicists in Medicine\n','2018-06-21 13:18:12.000000','2018-06-21 13:18:12.000000',1,14),(86,'锘縋ageRank-based prediction of award-winning researchers and the impact of citations\n','Tian-Zhui-ageRank-based-prediction-of-award-winning-researchers-and-the-impact-of-citations','In this article some recent disputes about the usefulness of PageRank-based methods for the task of identifying influential researchers in citation networks are discussed. In particular, it focuses on the performance of these methods in relation to simple citation counts. With the aim of comparing these two classes of ranking methods, we analyze a large citation network of authors based on almost two million computer science papers and apply four PageRank-based and citations-based techniques to rank authors by importance throughout the period 1990-2014 on a yearly basis. We use ACM SIGMOD E. F. Codd Innovations Award and ACM A. M. Turing Award winners in our baseline lists of outstanding scientists and define four relevance weighting schemes with some predictive power for the ranking methods to increase the relevance of researchers winning in the future. We conclude that citations-based rankings perform better for Codd Award winners, but PageRank-based methods do so for Turing Award recipients when using absolute ranks and PageRank-based rankings outperform the citations-based techniques for both Codd and Turing Award laureates when relative ranks are considered. However, the two ranking groups show smaller differences if more weight is assigned to the relevance of future awardees. (c) 2017 Elsevier Ltd. All rights reserved.\n','2018-06-21 13:18:40.000000','2018-06-21 13:18:40.000000',1,14),(87,'Monitoring and controlling energy distribution: Implementation of a distribution management system based on Common Information Model\n','Monitoring-and-controlling-energy-distribution-Implementation-of-a-distribution-management-system-based-on-Common-Information-Model','The management of renewable and distributed energy resources is changing the way in which electric distribution systems are being operated. Many companies commonly create several custom system solutions to manage power distribution. The functions provided by these systems are network visualization, state estimation, system control and data acquisition, among others. Despite their relevance, many midsize or small distribution companies have problems to install one of these solutions because they are either very expensive, incompatible, or limited by difficulties in data exchange. As a possible solution to this problem, this paper presents the development of a Distribution Management System (DMS) based on open source technology. This system combines four main components: OpenDSS-framework, ActiveMQ-broker, applications for visualizing and editing electrical network, and Common Information Model (CIM). The tool is part of Tenergia R&D project 1 and has a collection of applications designed to monitor and control the distribution networks located in Argentina. (C) 2017 Elsevier Ltd. All rights reserved.\n','2018-06-21 13:18:40.000000','2018-06-21 13:18:40.000000',1,14),(88,'锘縈odeling corrosion trends in tin-free steel and tinplate cans containing tomato paste via adaptive-network-based fuzzy inference system\n','Tian-Ying-odeling-corrosion-trends-in-tin-free-steel-and-tinplate-cans-containing-tomato-paste-via-adaptive-network-based-fuzzy-inference-system','Practical applicationsFood products might be preserved in metallic cans for more than 2years without any significant changes in organoleptic properties. One disadvantage is that cans are more susceptible to corrosion compared with other packaging materials. The absence of appropriate methods and the high costs of analytical instruments are major problems encountered in evaluating the corrosion process. On the other hand, developing straightforward and modern techniques may be an efficient solution in this area. This study was devoted to the prediction of the corrosion process using two prevalent can plates employed in the food industry. ANFIS modeling was implemented in tomato paste, which exhibits acidic and corrosive behavior. ANFIS modeling may be an onset for further research in this area to engineer and manufacture intelligent sensors by which on-line monitoring in complex and nonlinear interactions is undertaken.\n','2018-06-21 13:19:02.000000','2018-06-21 13:19:02.000000',1,14),(89,'An isolated toughness condition for graphs to be fractional (k, m)-deleted graphs\n','An-isolated-toughness-condition-for-graphs-to-be-fractional-k-m-deleted-graphs','if G is not complete; otherwise, I(G) = infinity. In this paper, we study the relationship between isolated toughness and fractional (k, m)-deleted graphs and determine that G is a fractional (k, m)-deleted graph if I (G) > k + m/k. At last, we propose an open problem for the future studying.\n','2018-06-21 13:19:02.000000','2018-06-21 13:19:02.000000',1,14),(90,'Urinary bladder cancer staging in CT urography using machine learning\n','Urinary-bladder-cancer-staging-in-CT-urography-using-machine-learning','ConclusionThe predictive model developed in this study shows promise as a classification tool for stratifying bladder cancer into two staging categories: greater than or equal to stage T2 and below stage T2.\n','2018-06-21 13:19:02.000000','2018-06-21 13:19:02.000000',1,14),(91,'A Similarity Analysis of Audio Signal to Develop a Human Activity Recognition Using Similarity Networks','A-Similarity-Analysis-of-Audio-Signal-to-Develop-a-Human-Activity-Recognition-Using-Similarity-Networks','                            Human Activity Recognition (HAR) is one of the main subjects of study in the areas of computer vision and machine learning due to the great benefits that can be achieved. Examples of the study areas are: health prevention, security and surveillance, automotive research, and many others. The proposed approaches are carried out using machine learning techniques and present good results. However, it is difficult to observe how the descriptors of human activities are grouped. In order to obtain a better understanding of the the behavior of descriptors, it is important to improve the abilities to recognize the human activities. This paper proposes a novel approach for the HAR based on acoustic data and similarity networks. In this approach, we were able to characterize the sound of the activities and identify those activities looking for similarity in the sound pattern. We evaluated the similarity of the sounds considering mainly two features: the sound location and the materials that were used. As a result, the materials are a good reference classifying the human activities compared with the location.\n\n                        ','2018-06-21 13:19:02.000000','2018-06-21 12:35:08.872482',1,14),(92,'A Better Model for Job Redundancy: Decoupling Server Slowdown and Job Size','A-Better-Model-for-Job-Redundancy-Decoupling-Server-Slowdown-and-Job-Size','                                                        Recent computer systems research has proposed using redundant requests to reduce latency. The idea is to replicate a request so that it joins the queue at multiple servers. The request is considered complete as soon as any one of its copies completes. Redundancy allows us to overcome serverside variability-the fact that a server might be temporarily slow due to factors such as background load, network interrupts, and garbage collection to reduce response time. In the past few years, queueing theorists have begun to study redundancy, first via approximations, and, more recently, via exact analysis. Unfortunately, for analytical tractability, most existing theoretical analysis has assumed an Independent Runtimes (IR) model, wherein the replicas of a job each experience independent runtimes (service times) at different servers. The IR model is unrealistic and has led to theoretical results that can be at odds with computer systems implementation results. This paper introduces a much more realistic model of redundancy. Our model decouples the inherent job size (X) from the serverside slowdown (S), where we track both S and X for each job. Analysis within the S&X model is, of course, much more difficult. Nevertheless, we design a dispatching policy, Redundant-to-Idle-Queue, which is both analytically tractable within the S&X model and has provably excellent performance.\n\n                        \n                        ','2018-06-21 13:19:02.000000','2018-06-29 03:23:01.342764',1,14),(93,'Design of computer experiments: A review\n','Design-of-computer-experiments-A-review','In this article, we present a detailed overview of the literature on the design of computer experiments. We classify the existing literature broadly into two categories, viz. static and adaptive design of experiments (DoE). We begin with the abundant literature available on static DoE, its chronological evolution, and its pros and cons. Our discussion naturally points to the challenges that are faced by the static techniques. The adaptive DoE techniques employ intelligent and iterative strategies to address these challenges by combining system knowledge with space-filling for sample placement. We critically analyze the adaptive DoE literature based on the key features of placement strategies. Our numerical and visual analyses of the static DoE techniques reveal the excellent performance of Sobol sampling (SOB3) for higher dimensions; and that of Hammersley (HAM) and Halton (HAL) sampling for lower dimensions. Finally, we provide several potential opportunities for the future modern DoE research. (C) 2017 Elsevier Ltd. All rights reserved.\n','2018-06-21 13:19:02.000000','2018-06-21 13:19:02.000000',1,14),(94,'锘縎urvey of recent progress in semantic image segmentation with CNNs\n','Tian-Gu-urvey-of-recent-progress-in-semantic-image-segmentation-with-CNNs','In recent years, convolutional neural networks (CNNs) are leading the way in many computer vision tasks, such as image classification, object detection, and face recognition. In order to produce more refined semantic image segmentation, we survey the powerful CNNs and novel elaborate layers, structures and strategies, especially including those that have achieved the state-of-the-art results on the Pascal VOC 2012 semantic segmentation challenge. Moreover, we discuss their different working stages and various mechanisms to utilize the structural and contextual information in the image and feature spaces. Finally, combining some popular underlying referential methods in homologous problems, we propose several possible directions and approaches to incorporate existing effective methods as components to enhance CNNs for the segmentation of specific semantic objects.\n','2018-06-21 13:19:22.000000','2018-06-21 13:19:22.000000',1,14),(95,'A generative vision model that trains with high data efficiency and breaks text-based CAPTCHAs\n','A-generative-vision-model-that-trains-with-high-data-efficiency-and-breaks-text-based-CAPTCHAs','Learning from a few examples and generalizing to markedly different situations are capabilities of human visual intelligence that are yet to be matched by leading machine learning models. By drawing inspiration from systems neuroscience, we introduce a probabilistic generative model for vision in which message-passing-based inference handles recognition, segmentation, and reasoning in a unified way. The model demonstrates excellent generalization and occlusion-reasoning capabilities and outperforms deep neural networks on a challenging scene text recognition benchmark while being 300-fold more data efficient. In addition, the model fundamentally breaks the defense of modern text-based CAPTCHAs (Completely Automated Public Turing test to tell Computers and Humans Apart) by generatively segmenting characters without CAPTCHA-specific heuristics. Our model emphasizes aspects such as data efficiency and compositionality that may be important in the path toward general artificial intelligence.\n','2018-06-21 13:19:22.000000','2018-06-21 13:19:22.000000',1,14),(96,'锘縎moke spreading analyses in a subway fire scale model\n','Tian-Gu-moke-spreading-analyses-in-a-subway-fire-scale-model','This paper is an experimental study of smoke spreading in a subway station. A subscale model based on the Fr Froude number similitude was elaborated. Smoke spreading was analyzed according to subway geometry (number of openings) and ventilation volumetric flow rate. In this context, evacuation way must remain smoke free to ensure the safety of passengers in case of fire on the platform. As the vertical of hot air may initiate stack effect, which is to be avoided, appropriate ventilation conditions needed to be determined. With this in mind, three main parameters were considered: ventilation mode (push-pull or extraction mode), stairway number, and railway network. The efficiency of push-pull and all extraction modes were compared to a single extraction mode with a reduction of critical volumetric flow approximating 19 and 13% respectively. The influence of pressure loss in tunnel opposite to ventilation on the stack effect was also studied. The outlet temperatures of stairways and free smoke areas were our major concern, and the safety criterion pointed out.\n','2018-06-21 13:19:39.000000','2018-06-21 13:19:39.000000',1,14),(97,'Cancer classification with a network of chemical oscillators\n','Cancer-classification-with-a-network-of-chemical-oscillators','We discuss chemical information processing considering dataset classifiers formed with a network of interacting droplets. Our arguments are based on computer simulations of droplets in which a photosensitive variant of the Belousov-Zhabotinsky (BZ) reaction proceeds. By applying optical control we can adjust the time evolution of individual droplets and prepare the network to perform a specific computational task. We demonstrate that chemical classifiers made of droplets can be designed in computer simulations based on evolutionary algorithms. The mutual information between the dataset and the observed time evolution of droplets in the network is taken as the fitness function in the optimization process. We show that a classifier of the Wisconsin Breast Cancer Dataset made of a relatively small number of droplets can distinguish between malignant and benign forms of cancer with an accuracy exceeding 97%. The reliability of the optimized chemical classifiers of this dataset as a function of optimization time, number of droplets involved in data processing and the method of extracting the output information is discussed.\n','2018-06-21 13:19:39.000000','2018-06-21 13:19:39.000000',1,14),(98,'Evolutionary Design of Classifiers Made of Droplets Containing a Nonlinear Chemical Medium\n','Evolutionary-Design-of-Classifiers-Made-of-Droplets-Containing-a-Nonlinear-Chemical-Medium','Unconventional computing devices operating on nonlinear chemical media offer an interesting alternative to standard, semiconductor-based computers. In this work we study in-silico a chemical medium composed of communicating droplets that functions as a database classifier. The droplet network can be programmed by an externally provided illumination pattern. The complex relationship between the illumination pattern and the droplet behavior makes manual programming hard. We introduce an evolutionary algorithm that automatically finds the optimal illumination pattern for a given classification problem. Notably, our approach does not require us to prespecify the signals that represent the output classes of the classification problem, which is achieved by using a fitness function that measures the mutual information between chemical oscillation patterns and desired output classes. We illustrate the feasibility of our approach in computer simulations by evolving droplet classifiers for three machine learning datasets. We demonstrate that the same medium composed of 25 droplets located on a square lattice can be successfully used for different classification tasks by applying different illumination patterns as its externally supplied program.\n','2018-06-21 13:19:39.000000','2018-06-21 13:19:39.000000',1,14),(99,'锘縀mbedded real-time speed limit sign recognition using image processing and machine learning techniques\n','Tian-Xia-mbedded-real-time-speed-limit-sign-recognition-using-image-processing-and-machine-learning-techniques','The number of traffic accidents in Brazil has reached alarming levels and is currently one of the leading causes of death in the country. With the number of vehicles on the roads increasing rapidly, these problems will tend to worsen. Consequently, huge investments in resources to increase road safety will be required. The vertical R-19 system for optical character recognition of regulatory traffic signs (maximum speed limits) according to Brazilian Standards developed in this work uses a camera positioned at the front of the vehicle, facing forward. This is so that images of traffic signs can be captured, enabling the use of image processing and analysis techniques for sign detection. This paper proposes the detection and recognition of speed limit signs based on a cascade of boosted classifiers working with haar-like features. The recognition of the sign detected is achieved based on the optimum-path forest classifier (OPF), support vector machines (SVM), multilayer perceptron, k-nearest neighbor (kNN), extreme learning machine, least mean squares, and least squares machine learning techniques. The SVM, OPF and kNN classifiers had average accuracies higher than 99.5 %; the OPF classifier with a linear kernel took an average time of 87 mu s to recognize a sign, while kNN took 11,721 ls and SVM 12,595 ls. This sign detection approach found and recognized successfully 11,320 road signs from a set of 12,520 images, leading to an overall accuracy of 90.41 %. Analyzing the system globally recognition accuracy was 89.19 %, as 11,167 road signs from a database with 12,520 signs were correctly recognized. The processing speed of the embedded system varied between 20 and 30 frames per second. Therefore, based on these results, the proposed system can be considered a promising tool with high commercial potential.\n','2018-06-21 13:20:32.000000','2018-06-21 13:20:32.000000',1,14),(100,'Machine learning to classify and predict objective and subjective assessments of vehicle dynamics: the case of steering feel\n','Machine-learning-to-classify-and-predict-objective-and-subjective-assessments-of-vehicle-dynamics-the-case-of-steering-feel','Objective measurements and computer-aided engineering simulations cannot be exploited to their full potential because of the high importance of driver feel in vehicle development. Furthermore, despite many studies, it is not easy to identify the relationship between objective metrics (OM) and subjective assessments (SA), a task further complicated by the fact that SA change between drivers and geographical locations or with time. This paper presents a method which uses two artificial neural networks built on top of each other that helps to close this gap. The first network, based solely on OM, generates a map that groups together similar vehicles, thus allowing a classification of measured vehicles to be visualised. This map objectively demonstrates that there exist brand and vehicle class identities. It also foresees the subjective characteristics of a new vehicle, based on its requirements, simulations and measurements. These characteristics are described by the neighbourhood of the new vehicle in the map, which is made up of known vehicles that are accompanied by word-clouds that enhance this description. This forecast is also extended to perform a sensitivity analysis of the tolerances in the requirements, as well as to validate previously published preferred range of steering feel metrics. The results suggest a few new modifications. Finally, the qualitative information given by this measurement-based classification is complemented with a second superimposed network. This network describes a regression surface that enables quantitative predictions, for example the SA of the steering feel of a new vehicle from its OM.\n','2018-06-21 13:20:32.000000','2018-06-21 13:20:32.000000',1,14),(101,'Correlation Between Resting-state Electroencephalographic Characteristics and Shooting Performance\n','Correlation-Between-Resting-state-Electroencephalographic-Characteristics-and-Shooting-Performance','According to the theories of neural plasticity and neural efficiency, professional skill training improves performance by strengthening the underlying neural mechanisms. Therefore, subjects trained professionally may exhibit changes in resting-state neurophysiological characteristics closely related to performance. To test this notion, the resting-state electroencephalogram (EEG) was measured from 35 rifle shooters after the same training regimen, and resting-state EEG characteristics were analyzed for correlations with shooting performance. The results showed a significant linear correlation between shooting performance and the coherence of electrode channels C3 and T3 in the beta1 band (r = 0.74, P < 4.2 x 10(-6)). There was also a significant linear correlation between the characteristic path length of the resting-state theta band brain network and shooting performance (r = 0.56, P < 0.0005). This study identifies potential neural mechanisms underlying successful shooting and a new method for predicting and evaluating performance based on EEG characteristics. (C) 2017 IBRO. Published by Elsevier Ltd. All rights reserved.\n','2018-06-21 13:20:32.000000','2018-06-21 13:20:32.000000',1,14),(102,'White Matter Connectivity Pattern Associate with Characteristics of Scalp EEG Signals\n','White-Matter-Connectivity-Pattern-Associate-with-Characteristics-of-Scalp-EEG-Signals','The rhythm of electroencephalogram (EEG) depends on the neuroanatomical-based parameters such as white matter (WM) connectivity. However, the impacts of these parameters on the specific characteristics of EEG have not been clearly understood. Previous studies demonstrated that, these parameters contribute the inter-subject differences of EEG during performance of specific task such as motor imagery (MI). Though researchers have worked on this phenomenon, the idea is yet to be understood in terms of the mechanism that underlies such differences. Here, to tackle this issue, we began our investigations by first examining the structural features related to scalp EEG characteristics, which are event-related desynchronizations (ERDs), during MI using diffusion MRI. Twenty-four right-handed subjects were recruited to accomplish MI tasks and MRI scans. Based on the high spatial resolution of the structural and diffusion images, the motor-related WM links, such as basal ganglia (BG)-primary somatosensory cortex (SM1) pathway and supplementary motor area (SMA)-SM1 connection, were reconstructed by using probabilistic white matter tractography. Subsequently, the relationships of WM characteristics with EEG signals were investigated. These analyses demonstrated that WM pathway characteristics, including the connectivity strength and the positional characteristics of WM connectivity on SM1 (defined by the gyrus-sulcus ratio of connectivity, GSR), have a significant impact on ERDs when doing MI. Interestingly, the high GSR of WM connections between SM1 and BG were linked to the better ERDs. These results therefore, indicated that the connectivity in the gyrus of SM1 interacted with MI network which played the critical role for the scalp EEG signal extraction of MI to a great extent. The study provided the coupling mechanism between structural and dynamic physiological features of human brain, which would also contribute to understanding individual differences of EEG in MI-brain computer interface.\n','2018-06-21 13:20:32.000000','2018-06-21 13:20:32.000000',1,14),(103,'全局变量报错：UnboundLocalError: local variable \'l\' referenced before assignment','Quan-Ju-Bian-Liang-Bao-Cuo-UnboundLocalError-local-variable-l-referenced-before-assignment','总结：\n内部函数，不修改全局变量可以访问全局变量\n内部函数，修改同名全局变量，则python会认为它是一个局部变量\n在内部函数修改同名全局变量之前调用变量名称（如print sum），则引发Unbound-LocalError\n在程序中设置的sum属于全局变量,而在函数中没有sum的定义,根据python访问局部变量和全局变量的规则：当搜索一个变量的时候，python先从局部作用域开始搜索，如果在局部作用域没有找到那个变量，那样python就在全局变量中找这个变量，如果找不到抛出异常(NAMEERROR或者Unbound-LocalError，这取决于python版本。)\n\n如果内部函数有引用外部函数的同名变量或者全局变量,并且对这个变量有修改.那么python会认为它是一个局部变量,又因为函数中没有sum的定义和赋值，所以报错。\n\n从下面两个程序看单独的访问或者修改全局变量，并不报错~\n\n#访问全局变量\n#!/usr/bin/python\nimportsys\nsum=5\ndefadd(a=1,b=3):\n    printa,b\n    print sum  #仅仅访问 \nadd(4,8)\nprintsum\n[root@rac3python]# python local.py\n48\n5\n5\n\n#修改同名的全局变量，则认为是一个局部变量\n#!/usr/bin/python\nimportsys\nsum=5\ndefadd(a=1,b=3):\n    print a,b\n         #内部函数有引用外部函数的同名变量或者全局变量,并且对这个变量有修改.那么python会认为它是一个局部变量\n    sum=b+a #在函数内部修改\n    print sum\nadd(4,8)\n[root@rac3python]# python local.py\n4 8\n12\n下面的程序就会因为“如果内部函数有引用外部函数的同名变量或者全局变量,并且对这个变量有修改.那么python会认为它是一个局部变量,又因为函数中没有sum的定义和赋值，所以报错\n#!/usr/bin/python\nimport sys\nsum=5\ndefadd(a=1,b=3):\n    print a,b\n    printsum  #内部函数引用同名变量，并且修改这个变量。python会认为它是局部变量。因为在此处print之前，没有定义sum变量，所以会报错（建议与情况一比较，备注：此处只是比上例先print sum）\n    sum=b+a\n    printsum\nadd(4,8)\nprint sum\n[root@rac3python]# python local.py\n48\nTraceback(mostrecentcalllast):\n File\"local.py\",line10,in?\n   add(4,8)\n File\"local.py\",line6,inadd\n   printsum\nUnboundLocalError:localvariable\'sum\'referencedbeforeassignment\n\n遇到在程序中访问全局变量并且要修改全局变量的值的情况可以使用：global关键字，在函数中声明此变量是全局变量\n#!/usr/bin/python\nimportsys\nsum=5\nprint\'改变之前：sum=\',sum\ndefadd(a=1,b=3):\n    globalsum\n    print\'add 函数中:sum=\',sum\n    sum=b+a\n    print\'函数中改变之后:sum= \',sum\nadd(4,8)\nprint\'改变之后 sum=\',sum\n[root@rac3python]# vim local.py\n改变之前：sum=5\nadd函数中:sum=5\n函数中改变之后:sum= 12\n改变之后sum=12','2018-06-27 07:51:11.279959','2018-06-27 07:53:22.620516',21,17),(104,'javascript实现页面跳转的几种方式','javascriptShi-Xian-Ye-Mian-Tiao-Zhuan-De-Ji-Chong-Fang-Shi','                            概述\n  **\n相信很多WEB开发者都知道，在开发WEB程序的时候，对于页面之间的跳转，有很多种，但是有效的跳转则事半功倍，下面就是我在平时的开发过程中所用到的一些JAVASCRIPT跳转方式，拿出和大家共享一下。**\n \n第一种：直接跳转加参数\n   \n\n     <script language=\"javascript\" type=\"text/javascript\">\n               window.location.href=\"login.jsp?backurl=\"+window.location.href; \n        </script>\n直接跳转无参数：\n \n\n    \n    <script>window.location.href=\'http://www.baidu.com\';</script>\n                        ','2018-06-28 15:01:00.982944','2018-07-04 00:14:59.441591',32,19);

